import React from 'react';

const TodoListItem = (props) => {
    return(
        <div className="row">
            <div className="col s12">
                <div className="card">
                    <span className="card-title">{props.todos.name}</span>
                    <div className="card-content">
                        <p>{props.todos.todoItem}</p>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default TodoListItem;
